        "title": "World's First Lightsaber! - Guinness World Records",
        "description": "Subscribe to never miss a video! || https://gwr.co/YT-Sub\nCheck out the GWR favourites! || http://gwr.co/YT-Favs\n\nThe first retractable proto-lightsaber was created by Hacksmith Industries (Canada), in Kitchener, Ontario, Canada, on 8 September 2020.\n\nHacksmith Industries: https://www.youtube.com/channel/UCjgpFI5dU-D1-kh9H1muoxQ\n\n----------------------------------------------------------------------------------------------\n\nAt Guinness World Records we want to show that everyone in the world is the best at something, and we‚Äôre here to measure it! Whether you‚Äôve got the stretchiest skin, know the world‚Äôs smallest dog or want to create the largest human dominoes chain we want to hear about it. \n\nHere on the Guinness World Records YouTube channel we want to showcase incredible talent. If you're looking for videos featuring the world's tallest, shortest, fastest, longest, oldest and most incredible things on the planet, you're in the right place.\n\n----------------------------------------------------------------------------------------------\n\nWebsite || http://bit.ly/GWR-Website\nFacebook || http://bit.ly/GWR-FB\nTwitter || http://bit.ly/GWR-TW\nInstagram || http://bit.ly/GWR-Insta\nSnapchat || http://bit.ly/GWR-SC\nTikTok || http://bit.ly/GWR-TT\n\nFor licensing: tv@guinnessworldrecords.com\n\n#GWR #GuinnessWorldRecords #WorldRecords",
